import React from "react";
import { useState, useEffect } from "react";
import AuthStyle from "../../../../styles/Auth/Auth.css";
import { useNavigate } from "react-router";
import { useDispatch, useSelector } from "react-redux";
import { fetchRegister } from "../../../../redux/reducers/Auth";
import { changeRequestRegist } from "../../../../redux/reducers/Auth";
import Input from '@mui/joy/Input';
import Button from '@mui/joy/Button';
import Select from '@mui/joy/Select';
import Option from '@mui/joy/Option';
import { Box, Chip } from '@mui/joy'
import Textarea from '@mui/joy/Textarea';


const { FormAuth } = AuthStyle


function Regist(props) {

    const request = useSelector(state => state.TypeAuth.request)

    let [login, setLogin] = useState(),
        [pass, setPass] = useState(),
        [secPass, setSecPass] = useState(),
        [name, setName] = useState(),
        [faculty, setFaculty] = useState(),
        [age, setAge] = useState(),
        [gender, setGender] = useState(),
        [hobby, setHobby] = useState(),
        [about, setAbout] = useState()

    const { flagCaptcha } = props

    const navigate = useNavigate()
    const dispatch = useDispatch()

    function sendData() {
        let data = {
            login: login,
            pass: pass,
            secPass: secPass,
            name: name,
            faculty: faculty,
            age: age,
            gender: gender,
            hobby: hobby,
            about: about
        }
        dispatch(fetchRegister({ data, dispatch }))
    }

    useEffect(() => {
        if (request != "") {
            alert(request)
            dispatch(changeRequestRegist(""))
        }
    }, [request])


    return (
        <>
            <Container>
                <LogoComp></LogoComp>
                <ContainerAuth>
                    <ContainerBtnsNav>
                        <Button type="submit" onClick={() => switchTypeAuth("login")} size="sm">Войти</Button>
                        <Button type="submit" onClick={() => switchTypeAuth("reg")} size="sm">Создать аккаунт</Button>
                    </ContainerBtnsNav>
                    {typeAuth === "reg" ? <Regist flagCaptcha={flagCaptcha}></Regist> : <Login flagCaptcha={flagCaptcha}></Login>}
                </ContainerAuth>
                <ContainerCaptha>
                    <Recaptcha
                        sitekey="6LeIxAcTAAAAAJcZVRqyHh71UMIEGNQ_MXjiZKhI"
                        render="explicit"
                        verifyCallback={() => {
                            setTimeout(() => {
                                setFlagCaptcha(false)
                            }, 60000)
                            setFlagCaptcha(true)
                        }}
                        onloadCallback={() => { console.log("loaded") }}
                    />
                </ContainerCaptha>
            </Container>
            <FormAuth onSubmit={(e) => {
                e.preventDefault();
                e.target.reset();
            }}>
                <Input
                    onChange={(event) => { setLogin(event.target.value) }}
                    placeholder="Введите логин"
                    size="md"
                    variant="soft"
                    type="email"
                    required={true}
                />
                <Input
                    onChange={(event) => { setPass(event.target.value) }}
                    type="password"
                    placeholder="Введите пароль"
                    size="md"
                    variant="soft"
                    required={true}
                />
                <Input
                    onChange={(event) => { setSecPass(event.target.value) }}
                    type="password"
                    placeholder="Повторите пароль"
                    size="md"
                    variant="soft"
                    required={true}
                />
                <Input
                    onChange={(event) => { setName(event.target.value) }}
                    placeholder="Имя"
                    size="md"
                    variant="soft"
                    required={true}
                />
                <Input
                    onChange={(event) => { setAge(event.target.value) }}
                    placeholder="Возраст"
                    size="md"
                    variant="soft"
                    type="number"
                    min="18"
                    required={true}
                />
                <Select required={true} placeholder="Пол" onChange={(event, newValue) => { setGender(newValue) }}>
                    <Option value="Мужской">Мужской</Option>
                    <Option value="Женский">Женский</Option>
                </Select>
                <Select required={true} placeholder="Факультет" onChange={(event, newValue) => { setFaculty(newValue) }}>
                    <Option value="ФГИиБ">ФГИиБ</Option>
                    <Option value="ФОП">ФОП</Option>
                    <Option value="КФ">КФ</Option>
                    <Option value="ПГ">ПГ</Option>
                </Select>
                <Select
                    multiple
                    style={{ dispay: "flex" }}
                    placeholder="Увлечения"
                    defaultValue={[]}
                    onChange={(target, newValue) => {
                        setHobby(newValue)
                    }}
                    renderValue={(selected) => (
                        <Box sx={{ display: 'flex', flexWrap: "wrap", gap: '0.25rem' }}>
                            {selected.map((selectedOption) => (
                                <Chip variant="soft" color="primary">
                                    {selectedOption.label}
                                </Chip>
                            ))}
                        </Box>
                    )}
                    sx={{
                        minWidth: '15rem',
                        maxWidth: "100px"
                    }}
                    slotProps={{
                        listbox: {
                            sx: {
                                width: '100%',
                            },
                        },
                    }}
                >
                    <Option value="Вектор">Вектор</Option>
                    <Option value="Спортклуб">Спортклуб</Option>
                    <Option value="Турклуб">Турклуб</Option>
                    <Option value="Продакшн">Продакшн</Option>
                </Select>
                <Textarea
                    onChange={(e, newValue) => { setAbout(newValue) }}
                    minRows={2}
                    placeholder="Немного о себе"
                    variant="soft"
                />
                <Button type="submit" disabled={!flagCaptcha} onClick={sendData}>Войти</Button>
            </FormAuth >
        </>
    )
}

export default Regist
